using System.Text;
using System.Linq.Dynamic.Core;
using System.Linq;
using DinkToPdf;
using System.IO;
using DinkToPdf.Contracts;
using LockthreatCompliance.BusinessEntities;

namespace LockthreatCompliance.AuditProjects.Importing
{
    public class SendCerficateMail
    {
        private readonly IRepository<CertificateImport> _certificateImportRepository;
        private IConverter _converter;
        private readonly IRepository<EntityApplicationSetting> _entityApplicationSettingRepository;

        public SendCerficateMail(IRepository<CertificateImport> certificateImportRepository, IConverter converter, IRepository<EntityApplicationSetting> entityApplicationSettingRepository)
        {
            _certificateImportRepository = certificateImportRepository;
            _converter = converter;
            _entityApplicationSettingRepository = entityApplicationSettingRepository;
        }
        public string GetCertificateValue ()
        {
            var getAllValue = _certificateImportRepository.GetAll();
            foreach(var item in getAllValue)
            {
                var sb = new StringBuilder();
                sb.Append(@"
<div style='padding-left:15%; padding-right:15%'>
<div class='kt-pt-50' style='background-image: url('../../../../assets/common/images/side-pattern.svg');background-repeat: no-repeat;'>
<div align='right' class='kt-padding-r-50'>
<img src='../../../../assets/common/images/AAMENlogin.svg' style='height:9em; width:11em'>
<img src='../../../../assets/common/images/DoH Logo.svg' style='height:9em; width:11em'>
</div>



<div align='center'>
<div>
<img src='../../../../assets/common/images/certificate of achievement.svg' style='height:7em; width:20em'>
</div>
<div style='padding-left:20%; padding-right:20%' class='kt-pb-15'>
<div class='h3 pt-4'><span style='background-color: rgb(255, 255, 255);'><font color='#085294'>It Is Hereby Certified That</font></span></div>
<div class='h3 pt-2'><font color='#4fa6b0'><u>");
                sb.Append(@" " + item.LicenseNumber +"-" + item.EntityName);
                sb.Append(@" </u></font></div>
<div class='h6 pt-4'><font color='#085294' style='background-color: rgb(255, 255, 255);'><b>Has successfully completed the audit and found to be compliant with the requirements&nbsp;<span style='font-size: 1rem; text-align: left;'>of&nbsp;</span></b></font></div>
<div class='h6 pt-4' style='color: rgb(79, 166, 176);'><b>Abu Dhabi Healthcare Information and Cyber Security [ADHICS] Standard'&nbsp;</b></div>
<div class='kt-font-sm pt-4 '><font color='#6badde'>The use and validity of this certificate are subject to compliance with the relevant rules and regulations and continual maintenance of the compliance achieved is as established by the certification rules of&nbsp;<span style='text-align: left;'>Department of&nbsp;</span><span style='font-size: 0.8rem; text-align: left;'>Health - Abu Dhabi</span></font></div>
<div align='right' class='kt-padding-t-5'>
<img id='barcode' src='");
                sb.Append(@"" + "data:image/png;base64,");
                sb.Append(@"' alt='' title='HELLO' width='100' height='100'>
<div class='pt-3'>Issue Date: ");
                sb.Append(@" " + Convert.ToDateTime(item.IssueDate).ToString("dd MMM yyyy"));
                sb.Append(@"</div>
<div class='pt-2'>Expiry Date: ");
                sb.Append(@" " + Convert.ToDateTime(item.ExpireDate).ToString("dd MMM yyyy"));
                sb.Append(@"</div>
</div>
</div>
</div>
</div>
</div>");
                var globalSettings = new GlobalSettings
                {
                    ColorMode = ColorMode.Color,
                    Orientation = Orientation.Portrait,
                    PaperSize = PaperKind.A4,
                    Margins = new MarginSettings() { Top = 5, Bottom = 5, Left = 5, Right = 5 },
                    DocumentTitle = "Audit Plan Report",

                };
                StringBuilder sb2 = new StringBuilder(sb.ToString());
                var pdf = new HtmlToPdfDocument()
                {
                    GlobalSettings = globalSettings,
                };

                var objectSettings = new ObjectSettings
                {

                    PagesCount = true,
                    HtmlContent = sb.ToString(),
                    WebSettings = { DefaultEncoding = "utf-8", UserStyleSheet = Path.Combine(Directory.GetCurrentDirectory(), "assets", "styles.css") },
                    HeaderSettings = { FontName = "Arial", FontSize = 9, Right = "Page [page] of [toPage]", Line = true },
                    //FooterSettings = { FontName = "Arial", FontSize = 9, Line = true, Center = "Emirsec Technologies" }
                };
                pdf.Objects.Add(objectSettings);
                var file = _converter.Convert(pdf);
                


                string webRootPath = _entityApplicationSettingRepository.GetAll().Where(x=>x.TenantId == 1).Select(x => x.Attachmentpath).FirstOrDefault();

                var uploads = Path.Combine(webRootPath, "Certificate");


                string route = uploads + "\\"+item.LicenseNumber+".pdf";

                //await _auditQuestionResponseDocumentPath.InsertAsync(documentPath);

                if (!Directory.Exists(uploads))
                {
                    Directory.CreateDirectory(uploads);
                }
                if (file.Length > 0)
                {

                    System.IO.File.WriteAllBytes(route, file);

                }
            }

            return "a";
        }
    }
}
